import React from 'react';
import './CatForm.css';

class CatForm extends React.Component{

	constructor(props){
		super(props)
		this.state={
			currentUrl:this.props.data.url,
			currentCounter:this.props.data.counter,
			currentName:this.props.data.name,
		}

	}
	render(){
	return(
			<div className="CatForm">
	          <form className="form">
	            <label className="labels">
	              Cat Name
	              <input type="text" value={this.state.currentName} />
	            </label>
	            <br/>
	            <label className="labels">
	              Cat Image
	              <input type="text" value={this.state.currentUrl}/>
	            </label>
	            <br/>
	            <label className="labels">
	              Cat Clicks
	              <input type="text" value={this.state.currentCounter}/>
	            </label>
	            <br/>
	            <input type="submit" value="Save" />
	            <input type="submit" value="Undo"/>
	          </form>
        	</div>
		);
}
}

export default CatForm;
